  true,\n\t\"url\": null,\n\t\"notes\": \"OTI's worldwide activity database is a simple
  and effective information system that serves as a program management, tracking,
  and reporting tool. In each country, the database serves as the main instrument
  for chronicling the life cycles and outcomes of individual activities and is the
  primary library of data from which working documents and internal and external reports
  are generated. Evaluators, peer review teams, and others who need to research active
  or past OTI programs use it to read the story of a program through its lifecycle.
  It also allows staff at headquarters to provide immediate, up-to-date information
  to audiences in Washington without needing to query field teams.\",\n\t\"license_title\":
